-- ----------------------------
-- Table structure for t_ppd_refund
-- ----------------------------
DROP TABLE IF EXISTS `t_ppd_refund`;
CREATE TABLE `t_ppd_refund`  (
  `PPD_RFD_NO` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '充值退回订单号',
  `PPD_RFD_DT` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '充值退回订单日期',
  `PPD_RFD_TM` varchar(6) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '充值退回订单时间',
  `REQ_BUS_NO` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '业务参考号，全局唯一',
  `REQ_JRN_NO` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '请求流水号',
  `REQ_DT` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '请求日期',
  `REQ_TM` varchar(6) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '请求时间',
  `REQ_SYS_CNL` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '请求系统渠道',
  `REQ_BUS_CNL` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '请求业务渠道',
  `REQ_SVR_NM` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '请求交易服务名',
  `REQ_TXN_CD` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '请求交易交易码',
  `REQ_RESERVED` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '保留字段，原样返回',
  `PPD_RFD_STS` varchar(2) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '充值退回订单状态',
  `PPD_RFD_FINISH_DT` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '充值退回订单完成日期',
  `PPD_RFD_FINISH_TM` varchar(6) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '充值退回订单完成时间',
  `PPD_ORD_NO` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '原充值订单号',
  `PPD_ORD_DT` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '原充值订单日期',
  `PPD_ORD_APL_AMT` decimal(18, 2) NOT NULL COMMENT '原充值扣款金额',
  `PPD_ORD_FEE_AMT` decimal(18, 2) NOT NULL COMMENT '原充值手续费金额',
  `PPD_ORD_ACT_AMT` decimal(18, 2) NOT NULL COMMENT '原充值到账金额',
  `CCY` varchar(5) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '货币类型',
  `USR_TYP` varchar(2) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '用户类型',
  `USR_NO` bigint(20) NOT NULL COMMENT '内部用户号',
  `USR_NM_CIPHER` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '用户姓名(密文)',
  `USR_NM_MASK` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '用户姓名(掩码)',
  `USR_MBL_NO_CIPHER` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '用户手机号(密文)',
  `USR_MBL_NO_MASK` varchar(16) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '用户手机号(掩码)',
  `USR_PROV` varchar(5) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '用户归属省份',
  `USR_CITY` varchar(5) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '用户归属城市',
  `MSG_CD` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '信息码',
  `MSG_INF` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '信息码描述',
  `PAY_RFD_NO` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '支付核心退回订单号',
  `PAY_RFD_DT` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '支付核心退回订单日期',
  `PAY_RFD_TM` varchar(6) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '支付核心退回订单时间',
  `PAY_RFD_STS` varchar(2) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '支付核心退回订单状态',
  `PAY_MSG_CD` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '支付核心信息码',
  `PAY_MSG_INF` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '支付核心信息码描述',
  `QUERY_NUM` varchar(3) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '充值退回订单查询次数',
  `CRE_TIME` varchar(14) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '充值退回订单创建时间yyyymmddhh24miss',
  `CRE_NOD_ID` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '充值退回订单创建节点',
  `CRE_LOG_ID` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '充值退回订单创建日志号',
  `UPD_LOG_ID` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '充值退回订单更新日志号',
  `NOD_ID` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '节点名',
  `REG_ID` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '集群名',
  `TM_SMP` varchar(26) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '时间戳',
  `RFD_AMT` decimal(18, 2) NOT NULL COMMENT '退款金额',
  PRIMARY KEY (`PPD_RFD_NO`, `PPD_RFD_DT`) USING BTREE,
  UNIQUE INDEX `T_PPD_REFUND_PK`(`PPD_RFD_NO`, `PPD_RFD_DT`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '充值退回订单表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for t_pub_btpinf
-- ----------------------------
DROP TABLE IF EXISTS `t_pub_btpinf`;
CREATE TABLE `t_pub_btpinf`  (
  `NAME` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '任务名',
  `SQL_TEXT` varchar(2000) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '任务SQL',
  `OBJ_SVR` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '任务调用服务名',
  `OBJ_TXNCD` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '任务调用交易码',
  `INTERVAL` bigint(20) NOT NULL DEFAULT 60 COMMENT '任务间隔时间[单位秒]',
  `LAST_TIM` bigint(20) NOT NULL DEFAULT 0 COMMENT '任务最后执行时间',
  `MAX_TMS` bigint(20) NOT NULL DEFAULT 5 COMMENT '任务最大次数',
  `BEG_TM` varchar(6) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '000000' COMMENT '任务开始时间',
  `END_TM` varchar(6) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '235959' COMMENT '任务结束时间',
  `CONC_NUM` bigint(20) NOT NULL DEFAULT 1 COMMENT '任务并发数',
  `STS` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '1' COMMENT '任务状态[1:正常;0:停止;]',
  `NOD_ID` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '任务执行节点ID',
  `UPD_OPR` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '更新操作员',
  `RMK` varchar(80) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '备注',
  `TM_SMP` varchar(26) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '时间戳',
  `STATE` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '1' COMMENT '?',
  `APP_NM` varchar(12) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '应用名',
  PRIMARY KEY (`NAME`) USING BTREE,
  UNIQUE INDEX `T_PUB_BTPINF_PK`(`NAME`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '定时联机批量配置表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of t_pub_btpinf
-- ----------------------------
INSERT INTO `t_pub_btpinf` VALUES ('APR-ApprovalNotify', 'select APR_ORD_NO,APR_JRN_NO from GSDTCR.T_APR_OPRJNL where APR_OPR_STS in (\'U\',\'X\') and APR_OPR_TYP in (\'E\',\'R\') and APR_OPR_MOD=\'C\'', 'aprsysbpc1', 'aprAsynHandle', 60, 1597737827, 100, '000000', '236000', 5, '1', 'transcore-withdraw.transcore-withdraw_129', ' ', '审核结果通知', '20200818160347', 'U', 'PUB');
INSERT INTO `t_pub_btpinf` VALUES ('RPM-cancelOrder', 'select   count(*) from T_RPM_ORD where to_char(sysdate,\'yyyymmdd\')=CRE_DT and  ORD_STS in (\'BC\',\'BB\')', 'rpmsysbpc1', 'cancelOrder', 10, 1597737876, 5, '000000', '235900', 1, '1', 'transcore-consume.rpm', ' ', '消费订单作废处理', '20200818160436', 'U', 'PUB');
INSERT INTO `t_pub_btpinf` VALUES ('TRAN-OrderQuery', 'select TAM_ORD_NO from T_TAM_ORDLT a  where a.tam_ord_sts in (\'P2\')  order by TAM_ORD_NO desc', 'tampaybpc1', 'ordTimeQuery', 300, 1561427584, 100, '000000', '236000', 5, '1', 'tran_region.transcore-trandraw_79', ' ', '延时转账订单查询补偿', '20190625095304', 'U', 'PUB');
INSERT INTO `t_pub_btpinf` VALUES ('WDC-HoldProcess', 'select WDC_ORD_NO from T_WDC_ORDR where WDC_ORD_STS=\'U0\' and PAY_STS in (\'U\',\'X\')  order by WDC_ORD_NO', 'wdcsysbpc1', 'holdProcess', 60, 1597737827, 100, '000000', '236000', 5, '1', 'transcore-withdraw.transcore-withdraw_129', ' ', '冻结处理', '20200818160347', 'U', 'PUB');
INSERT INTO `t_pub_btpinf` VALUES ('WDC-OffBankOrderSync', 'select WDC_ORD_NO from T_WDC_ORDR where WDC_ORD_STS = \'PS\' and PAY_STS in (\'U\',\'X\') and WDC_MOD = \'W\' and UPD_DT||UPD_TM < to_char(sysdate - 1/144,\'yyyymmddhh24miss\') order by WDC_ORD_NO desc', 'wdcsysbpc1', 'offlineBankOrderSync', 60, 1597737827, 100, '000000', '236000', 5, '1', 'transcore-withdraw.transcore-withdraw_129', ' ', '转网银成功同步支付核心', '20200818160347', 'U', 'PUB');
INSERT INTO `t_pub_btpinf` VALUES ('WDC-OrderPayApprovalSend', 'select WDC_ORD_NO from T_WDC_ORDR where WDC_ORD_STS=\'W0\' and PAY_STS=\'S\' and (RRC_APR_FLG=\'Y\' or FIN_APR_FLG=\'Y\') order by WDC_ORD_NO', 'wdcsysbpc1', 'orderApprovalSend', 60, 1597737827, 100, '000000', '236000', 5, '1', 'transcore-withdraw.transcore-withdraw_129', ' ', '提现审核发送', '20200818160347', 'U', 'PUB');
