INSERT INTO `t_pub_btpinf` VALUES ('WDC-OrderPaySend', 'select WDC_ORD_NO from T_WDC_ORDR where WDC_ORD_STS=\'WP\' and PAY_STS in (\'U\',\'X\')  order by WDC_ORD_NO', 'wdcsysbpc1', 'orderPaySend', 60, 1597737827, 100, '000000', '236000', 5, '1', 'transcore-withdraw.transcore-withdraw_129', ' ', '付款发送', '20200818160347', 'U', 'PUB');
INSERT INTO `t_pub_btpinf` VALUES ('WDC-OrderRefund', 'select WDC_ORD_NO from T_WDC_ORDR where WDC_ORD_STS=\'RP\' and PAY_STS in (\'U\',\'X\') and to_date(UPD_DT||UPD_TM,\'yyyy-mm-dd hh24:mi:ss\') < sysdate-1/144 order by WDC_ORD_NO', 'wdcsysbpc1', 'orderRefund', 300, 1597737602, 100, '000000', '236000', 5, '1', 'transcore-withdraw.transcore-withdraw_129', ' ', '退款处理', '20200818160002', 'U', 'PUB');
