-- ----------------------------
-- Table structure for t_rpm_expc
-- ----------------------------
DROP TABLE IF EXISTS `t_rpm_expc`;
CREATE TABLE `t_rpm_expc`  (
  `ORD_NO` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '内部订单号',
  `CRE_DT` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '订单建立日期',
  `ORD_EXP_DT` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '当前状态过期系统日期',
  `ORD_EXP_TM` varchar(6) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '当前状态过期系统时间',
  `REC_STS` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '记录状态',
  `PAY_TYP` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '支付方式',
  `TM_SMP` varchar(26) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '时间戳',
  `NOD_ID` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '节点ID',
  `REQ_ID` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ',
  PRIMARY KEY (`ORD_NO`, `CRE_DT`) USING BTREE,
  UNIQUE INDEX `T_RPM_EXPC_PK`(`ORD_NO`, `CRE_DT`) USING BTREE,
  INDEX `T_RPM_EXPC_NI1`(`ORD_EXP_DT`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '订单过期控制表' ROW_FORMAT = Dynamic;

