  `TX_AMT3` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '资金种类3金额',
  `FEE_AMT3` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '资金种类3费用金额',
  `RFD_AMT3` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '资金种类3退款金额',
  `RFD_FEE_AMT3` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '资金种类3已退手续费金额',
  `TX_CAP_TYP4` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '资金种类4',
  `TX_AMT4` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '资金种类4金额',
  `FEE_AMT4` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '资金种类4费用金额',
  `RFD_AMT4` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '资金种类4退款金额',
  `RFD_FEE_AMT4` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '资金种类4已退手续费金额',
  `TX_CAP_TYP5` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '资金种类5',
  `TX_AMT5` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '资金种类5金额',
  `FEE_AMT5` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '资金种类5费用金额',
  `RFD_AMT5` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '资金种类5退款金额',
  `RFD_FEE_AMT5` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '资金种类5已退手续费金额',
  `TX_CAP_TYP6` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '资金种类6',
  `TX_AMT6` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '扩展金额1',
  `FEE_AMT6` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '扩展金额1费用金额',
  `RFD_AMT6` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '扩展金额1退款金额',
  `TX_CAP_TYP7` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '资金种类7',
  `TX_AMT7` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '扩展金额2',
  `FEE_AMT7` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '扩展金额2费用金额',
  `RFD_AMT7` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '扩展金额2退款金额',
  `RSV_FLD` varchar(512) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '保留字段',
