  `STL_AMT4` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '资金种类4结算金额',
  PRIMARY KEY (`ORD_NO`, `CRE_DT`) USING BTREE,
  UNIQUE INDEX `T_RPM_OAMT_PK`(`ORD_NO`, `CRE_DT`) USING BTREE
