DROP TABLE IF EXISTS `t_rpm_rtul`;
CREATE TABLE `t_rpm_rtul`  (
  `ORD_NO` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '内部订单号',
  `CRE_DT` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '订单建立日期',
  `RFD_APL_JRN` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '退款申请流水号',
  `RFD_STS` varchar(2) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '退款状态',
  `MERC_ID` varchar(15) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '商户编号',
  `MERC_NM` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '商户名称',
  `MERC_ABBR` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '商户简称',
  `MERC_ORD_NO` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '商户订单号',
  `MERC_RFD_SEQ` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '商户退款子序号',
  `ORD_DT` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '商户订单日期',
  `PAY_TYP` varchar(2) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '1' COMMENT '订单支付类型',
  `RFD_APL_DT` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '退款申请日期',
  `RFD_APL_TM` varchar(6) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '退款申请时间',
  `RCV_FLG` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '收货标志',
  `NEED_RFD_FLG` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '是否需要退款',
  `RFD_RSN_CLS` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '退款原因类别',
  `CUR_TX_AMT` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '本次交易金额',
  `CUR_RFD_AMT` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '本次退款金额',
  `CUR_PYE_AMT` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '本次收款金额',
  `RFD_DESC` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '退款说明',
  `MERC_PROC_DESC` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '商户处理说明',
  `CLR_MERC_ID` varchar(15) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '清算商户号',
  `RFD_APL` varchar(15) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '退款申请人',
  `RFD_VCH1` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '退款凭证1',
  `RFD_VCH2` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '退款凭证2',
  `USR_OPR_ID` bigint(20) NOT NULL DEFAULT 0 COMMENT '申请人操作员内部号',
  `MBL_NO_CIPHER` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '0' COMMENT '用户手机号',
  `USR_ALIAS` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '用户别名',
  `MESC_PROC_DT` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '商户处理日期',
  `MESC_PROC_TM` varchar(6) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '商户处理时间',
  `RFD_ACC_DT` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '退款会计日期',
  `WHL_RFD_FLG` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '全额退款标志',
  `MERC_FEE_MOD` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '商户服务费收费方式',
  `FEE_RFD_FLG` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '手续费退还标志',
  `FEE_DT` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '手续费收取日期',
  `CUR_RFD_MERC_AMT` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '本次商户退款交易金额',
  `CUR_RFD_MESC_FEE` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '本次商户退款交易服务费',
  `CUR_RFD_INV_AMT` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '本次退款发票交易金额',
  `CUR_RFD_INV_FEE` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '本次退款发票服务费',
  `CUR_RFD_USTL_AMT` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '本次退款不结算金额',
  `LAST_OPR_ID` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '最后操作商户操作员内部号',
  `RFS_RSN` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '拒付原因',
  `SWT_DPU_NO` bigint(20) NOT NULL DEFAULT 0 COMMENT '转争议流水号',
  `TX_CAP_TYP1` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '资金种类1',
  `FEE_AMT1` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '资金种类1费用金额',
  `RFD_AMT1` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '资金种类1退款金额',
  `TX_CAP_TYP2` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '资金种类2',
  `FEE_AMT2` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '资金种类2费用金额',
  `RFD_AMT2` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '资金种类2退款金额',
  `TX_CAP_TYP3` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '资金种类3',
  `FEE_AMT3` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '资金种类3费用金额',
  `RFD_AMT3` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '资金种类3退款金额',
  `TX_CAP_TYP4` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '资金种类4',
  `FEE_AMT4` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '资金种类4费用金额',
  `RFD_AMT4` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '资金种类4退款金额',
  `TX_CAP_TYP5` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '资金种类5',
  `FEE_AMT5` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '资金种类5费用金额',
  `RFD_AMT5` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '资金种类5退款金额',
  `TX_CAP_TYP6` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '资金种类6',
  `TX_AMT6` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '扩展金额1',
  `RFD_AMT6` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '扩展金额1退款金额',
  `TX_CAP_TYP7` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '资金种类7',
  `TX_AMT7` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '扩展金额2',
  `RFD_AMT7` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '扩展金额2退款金额',
  `LAST_RFD_SEQ` bigint(20) NOT NULL DEFAULT 0 COMMENT '最后退款序号',
  `RDY_RPT_TMS` bigint(20) NOT NULL DEFAULT 0 COMMENT '已重发次数',
  `TM_SMP` varchar(26) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '时间戳',
  `WC_WF_STS` varchar(2) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '提现付款状态',
  `RSK_APPR_STS` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '审批状态',
  `RSK_WARN_CD` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '审批操作码',
  `RSK_WARN_RSN` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '审批操作描述',
  `RSK_APPR_OPR` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '审批操作员',
  `RSK_RMK` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '审批备注',
  `PS_APPR_STS` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '复审状态',
  `PS_APPR_OPR` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '复审操作员',
  `PS_APPR_RMK` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '备注',
  `PS_WFF_STS` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '复审状态',
  `PS_WFF_OPR` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '审批操作员',
  `PS_WFF_RMK` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '审批备注',
  `NOD_ID` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '节点ID',
  `RFD_TX_DT` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '退款系统日期',
  PRIMARY KEY (`ORD_NO`, `CRE_DT`, `RFD_APL_JRN`) USING BTREE,
  UNIQUE INDEX `T_RPM_RTUL_UI1`(`MERC_ID`, `MERC_ORD_NO`, `RFD_APL_JRN`) USING BTREE,
  UNIQUE INDEX `T_RPM_RTUL_PK`(`ORD_NO`, `CRE_DT`, `RFD_APL_JRN`) USING BTREE,
  INDEX `T_RPM_RTUL_NI1`(`MESC_PROC_DT`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '远程消费退款明细表' ROW_FORMAT = Dynamic;

