-- ----------------------------
-- Table structure for t_rpm_txnj
-- ----------------------------
DROP TABLE IF EXISTS `t_rpm_txnj`;
CREATE TABLE `t_rpm_txnj`  (
  `JRN_NO` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '0' COMMENT '交易流水号',
  `TX_CD` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '渠道交易码',
  `TX_TYP` varchar(2) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '交易类型',
  `SUB_BUS_TYP` varchar(4) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '业务子类型',
  `BUS_CNL` varchar(5) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '业务受理渠道',
  `SYS_CNL` varchar(5) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '系统接入渠道',
  `TX_SYS_DT` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '交易系统日期',
  `TX_SYS_TM` varchar(6) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '交易系统时间',
  `TX_ACC_DT` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '交易记账日期',
  `RVS_TX_FLG` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '冲正交易标志',
  `TX_STS` varchar(2) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '交易状态',
  `RSP_CD` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '响应码',
  `MSG_TYP` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '返回信息码类型',
  `ORD_NO` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '内部订单号',
  `CRE_DT` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '订单建立日期',
  `MERC_DC_FLG` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '商户借贷方标志',
  `USR_DC_FLG` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '用户借贷方标志',
  `MERC_ID` varchar(15) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '商户编号',
  `MERC_ORD_NO` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '商户订单号',
  `MERC_REQ_NO` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '商户请求号',
  `ORD_DT` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '商户订单日期',
  `ORD_CAP_TYP` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '订单资金类型',
  `ORD_AMT` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '订单金额',
  `ORD_JRN` bigint(20) NOT NULL DEFAULT 0 COMMENT '商户订单流水号',
  `MER_OPR_NO` bigint(20) NOT NULL DEFAULT 0 COMMENT '商户操作员内部号',
  `MERC_PROV` varchar(4) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '商户归属省',
  `MERC_CITY` varchar(4) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '商户归属市',
  `MERC_USR_NO` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '商户内部用户号',
  `USR_USR_NO` bigint(20) NOT NULL DEFAULT 0 COMMENT '用户内部用户号',
  `USR_PROV` varchar(4) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '用户归属省',
  `USR_CITY` varchar(4) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '用户归属市',
  `TX_AMT` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '交易金额',
  `RFD_MERC_AMT` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '退款交易金额',
  `PYE_TX_AMT` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '收款交易金额',
  `TX_FEE_AMT` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '交易服务费',
