DROP TABLE IF EXISTS `t_tam_collt`;
CREATE TABLE `t_tam_collt`  (
  `USR_NO` bigint(20) NOT NULL COMMENT '内部用户号',
  `COL_USR_NO` bigint(20) NOT NULL COMMENT '联系人内部用户号',
  `COL_MBL_NO_CIPHER` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '联系人手机号密文',
  `COL_MBL_NO_MASK` varchar(22) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '0' COMMENT '联系人手机号掩码',
  `MBL_NO_CIPHER` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '用户手机号密文',
  `MBL_NO_MASK` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '0' COMMENT '用户手机号掩码',
  `COL_NM_CIPHER` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '联系人姓名密文',
  `COL_NM_MASK` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '联系人姓名掩码',
  `COL_SEX` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '0' COMMENT '性别',
  `SMS_LBL` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '昵称',
  `COL_FLG` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '0' COMMENT '联系人标志',
  `COL_STS` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '0' COMMENT '联系人状态',
  `COL_EMAIL` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '联系人电子邮件',
  `COL_CNM` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '联系人单位名称',
  `COL_ADDR` varchar(120) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '联系人地址',
  `BAK_MBL_NO` varchar(11) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '0' COMMENT '备用手机号',
  `COL_TEL_NO` varchar(18) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '固定电话号',
  `RCT_DTTM` varchar(14) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '累计使用日期时间',
  `RCT_CNT` varchar(5) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '0' COMMENT '累计使用次数',
  `COL_TYP` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '0' COMMENT '联系人类型',
  `UPD_DT` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '最近更新日期',
  `TM_SMP` varchar(26) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '时间戳',
  `NOD_ID` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '交易发生节点名',
  PRIMARY KEY (`USR_NO`, `COL_USR_NO`) USING BTREE,
  UNIQUE INDEX `T_TAM_COLLT_PK`(`USR_NO`, `COL_USR_NO`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '转账联系人表，记录收款账户联系人。' ROW_FORMAT = Dynamic;

