-- ----------------------------
-- Table structure for t_tam_famord
-- ----------------------------
DROP TABLE IF EXISTS `t_tam_famord`;
CREATE TABLE `t_tam_famord`  (
  `FAM_ORD_NO` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '亲情账户订单号',
  `FAM_ORD_DT` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '交易日期,YYYYMMDD格式',
  `FAM_TX_TM` varchar(6) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '交易时间,HH24MISS格式',
  `FAM_TX_AMT` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '交易金额',
  `PAY_USR_NO` bigint(20) NOT NULL COMMENT '付款用户号',
  `FAM_USR_NO` bigint(20) NOT NULL COMMENT '亲情账号',
  `CAP_CORG` varchar(16) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '发卡行',
  `CRD_NO_CIPHER` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ',
  `CRD_NO_MASK` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '卡掩码',
  `FAM_NM_CIPHER` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '亲情账号用户名密文',
  `FAM_NM_MASK` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '亲情账号用户名掩码',
  `PAY_TYP` varchar(2) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ',
  `FAM_STS` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '亲情订单状态  U:初始化  S:成功  F:失败   C:已撤销（退款）',
  `CRT_DT` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '建立日期',
  `CRT_TM` varchar(6) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '建立时间',
  `NOD_ID` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '交易发生节点名',
  `RMK` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '备注',
  `TM_SMP` varchar(26) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '时间戳',
  PRIMARY KEY (`FAM_ORD_NO`, `FAM_ORD_DT`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '亲情账户交易信息' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for t_tam_jrnlt
-- ----------------------------
DROP TABLE IF EXISTS `t_tam_jrnlt`;
CREATE TABLE `t_tam_jrnlt`  (
  `TAM_JRN_NO` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '外发流水号',
  `TAM_ORD_NO` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '转账订单号',
  `TX_TYP` varchar(2) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '交易类型',
  `BUS_TYP` varchar(4) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '业务类型',
  `TX_DT` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '交易日期',
  `TX_TM` varchar(6) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '交易时间',
  `TRN_AMT` decimal(18, 2) NOT NULL COMMENT '转账出款金额',
  `RCV_AMT` decimal(18, 2) NOT NULL COMMENT '转账收款金额',
  `TRC_FEE` decimal(18, 2) NOT NULL COMMENT '手续费金额',
  `TX_STS` varchar(2) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '流水状态',
  `TM_SMP` varchar(26) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '时间戳',
  `NOD_ID` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '节点ID',
  PRIMARY KEY (`TAM_JRN_NO`, `TX_DT`) USING BTREE,
  UNIQUE INDEX `T_TAM_JRNLT_PK`(`TAM_JRN_NO`, `TX_DT`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '转账外发流水表' ROW_FORMAT = Dynamic;

