DROP TABLE IF EXISTS `t_tam_ordlt`;
CREATE TABLE `t_tam_ordlt`  (
  `TAM_ORD_NO` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '订单号',
  `ORD_DT` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '订单日期',
  `ORD_TM` varchar(6) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '订单时间',
  `ORD_EXP_DT` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '订单失效日期',
  `ORD_EXP_TM` varchar(6) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '订单失效时间',
  `ORD_CAP_TYP` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '资金种类',
  `ORD_CCY` varchar(3) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '转账币种',
  `MSG_CD` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '信息码',
  `MSG_TYP` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '信息码类型',
  `TAM_ORD_STS` varchar(2) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '订单状态',
  `TRN_MBL_NO_CIPHER` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '付款人手机号密文',
  `TRN_MBL_NO_MASK` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '0' COMMENT '付款人手机号掩码',
  `TRN_USR_NO` bigint(20) NOT NULL DEFAULT 0 COMMENT '付款人内部用户号',
  `TRN_NM_CIPHER` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '付款人姓名密文',
  `TRN_NM_MASK` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '付款人姓名掩码',
  `TRN_AMT` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '付款金额',
  `TRN_DT` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '付款日期',
  `TRN_TM` varchar(6) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '付款时间',
  `TRN_PROV` varchar(4) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '付款人归属省',
  `TRN_CITY` varchar(4) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '付款人归属市',
  `TRN_SYS_CNL` varchar(5) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '系统渠道',
  `TRN_BUS_CNL` varchar(5) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '业务渠道',
  `RCV_MBL_NO_CIPHER` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '收款人手机号密文',
  `RCV_MBL_NO_MASK` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '0' COMMENT '收款人手机号掩码',
  `RCV_USR_NO` bigint(20) NOT NULL DEFAULT 0 COMMENT '收款人用户号',
  `RCV_NM_CIPHER` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '收款人姓名密文',
  `RCV_NM_MASK` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '收款人姓名掩码',
  `RCV_AMT` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '收款金额',
  `RCV_DT` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '收款日期',
  `RCV_TM` varchar(6) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '收款时间',
  `RCV_PROV` varchar(4) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '收款人归属省',
  `RCV_CITY` varchar(4) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '收款人归属市',
  `RCV_SYS_CNL` varchar(5) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '收款系统渠道',
  `RCV_BUS_CNL` varchar(5) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '收款业务渠道',
  `TRC_TYP` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '收付款类型',
  `TRC_FEE` decimal(18, 2) NOT NULL DEFAULT 0.00 COMMENT '转账手续费',
  `USR_FEE_DDT_FLG` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '费率计费扣除类型（0内扣；1外扣',
  `TRC_RMK` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '备注',
  `TM_SMP` varchar(26) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '时间戳',
  `RCV_CITY_NM` varchar(80) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '收款人归属市名称',
  `TRN_CITY_NM` varchar(80) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '付款人归属市名称',
  `RSK_APPR_STS` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '风控审批状态',
  `RSK_WARN_CD` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '风控警示码',
  `RSK_WARN_RSN` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '风控警示码原因',
  `TAM_TYP` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '0' COMMENT '转账类型 0:账到帐；1:卡到卡',
  `TRN_CRD_NO_CIPHER` varchar(126) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '付款方卡号密文',
  `TRN_CRD_NO_MASK` varchar(126) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '付款方卡号掩码',
  `TRN_CRD_NM_CIPHER` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '付款方户名密文',
  `TRN_CRD_NM_MASK` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '付款方户名掩码',
  `RCV_CRD_NO_CIPHER` varchar(126) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '收款方卡号密文',
  `RCV_CRD_NO_MASK` varchar(126) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '收款方卡号掩码',
  `RCV_CRD_NM_CIPHER` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '收款方户名密文',
  `RCV_CRD_NM_MASK` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '收款方户名掩码',
  `TRN_BNK_CD` varchar(12) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '付款银行编号',
  `RCV_BNK_CD` varchar(12) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '收款银行编号',
  `TRN_CRD_TYP` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '付款方卡类别 0:借记卡；1:贷记卡',
  `RCV_CRD_TYP` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '收款方卡类别 0:借记卡；1:贷记卡',
  `RCV_BT_FLG` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '1' COMMENT '收款方标识 0:本 人: 1:他人',
  `RCV_ID_NO_CIPHER` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '收款方身份证号码密文',
  `RCV_ID_NO_MASK` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '收款方身份证号码掩码',
  `CHK_DT` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '对账日期',
  `CHK_TM` varchar(6) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '对账时间',
  `CHK_STS` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '0' COMMENT '对账状态 1：对账成功 2：我方有对方无 3：对方有我方无 4：关键信息不符',
  `TAM_TM` varchar(14) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '预计到账时间（年月日时分秒）',
  `DELAY_TYP` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '延迟转账类型0 实时转账1两小时转账2二十四小时转账',
  `NOD_ID` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT 'NOD_ID',
  `REQ_BUS_NO` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '请求流水号',
  `REQ_JRN_NO` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '上级请求流水号',
  `TAM_JRN_NO` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '外发支付核心流水号',
  `TAM_SYS_CNL` varchar(5) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '上级请求系统渠道',
  `REQ_SYS_CNL` varchar(5) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ',
  `PAY_TOOL` varchar(4) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT '支付工具',
  `FAM_USR_NO` bigint(20) NOT NULL DEFAULT 0 COMMENT '亲情账户用户号',
  PRIMARY KEY (`TAM_ORD_NO`, `ORD_DT`) USING BTREE,
  UNIQUE INDEX `T_TAM_ORDLT_PK`(`TAM_ORD_NO`, `ORD_DT`) USING BTREE,
  INDEX `T_TAM_ORDLT_UI4`(`RCV_USR_NO`) USING BTREE,
  INDEX `T_TAM_ORDLT_UI3`(`RCV_MBL_NO_CIPHER`) USING BTREE,
  INDEX `T_TAM_ORDLT_UI2`(`TRN_USR_NO`) USING BTREE,
  INDEX `T_TAM_ORDLT_UI1`(`TRN_MBL_NO_CIPHER`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '收付款订单表，记录收付款订单。' ROW_FORMAT = Dynamic;

