DROP VIEW IF EXISTS `v_cps_txord`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `v_cps_txord` AS (select `a`.`usr_no` AS `USR_NO`,`a`.`ord_no` AS `ORD_NO`,`a`.`txn_amt` AS `TXN_AMT`,`a`.`ord_sts` AS `ORD_STS`,`a`.`tx_typ` AS `TX_TYP`,`a`.`ord_dt` AS `ORD_DT`,`a`.`ord_tm` AS `ORD_TM`,`a`.`ord_desc` AS `ORD_DESC`,`a`.`ord_sts_info` AS `ORD_STS_INFO`,`a`.`rmk` AS `RMK`,`a`.`dc_pty_flg` AS `DC_PTY_FLG`,`a`.`nm_mask` AS `NM_MASK`,`a`.`pay_mod` AS `PAY_MOD` from (select `j`.`PAY_USR_NO` AS `usr_no`,`j`.`FAM_ORD_NO` AS `ord_no`,`j`.`FAM_TX_AMT` AS `txn_amt`,`j`.`FAM_STS` AS `ord_sts`,'10' AS `tx_typ`,`j`.`FAM_ORD_DT` AS `ord_dt`,`j`.`FAM_TX_TM` AS `ord_tm`,'Human relations' AS `ord_desc`,'无' AS `ord_sts_info`,`j`.`RMK` AS `rmk`,'D' AS `dc_pty_flg`,`j`.`FAM_NM_MASK` AS `nm_mask`,`j`.`PAY_TYP` AS `pay_mod` from `gsdtcr`.`t_tam_famord` `j` union all select `i`.`USR_NO` AS `usr_no`,`i`.`WDC_ORD_NO` AS `ord_no`,`i`.`WDC_APL_AMT` AS `txn_amt`,`i`.`WDC_ORD_STS` AS `ord_sts`,'04' AS `tx_typ`,`i`.`ORD_DT` AS `ord_dt`,`i`.`ORD_TM` AS `ord_tm`,'Withdrawal' AS `ord_desc`,'无' AS `ord_sts_info`,`i`.`WDC_RMK` AS `rmk`,'D' AS `dc_pty_flg`,`i`.`USR_NM_MASK` AS `nm_mask`,' ' AS `pay_mod` from `gsdtcr`.`t_wdc_ordr` `i` union all select `h`.`TRN_USR_NO` AS `usr_no`,`h`.`TAM_ORD_NO` AS `ord_no`,`h`.`RCV_AMT` AS `txn_amt`,`h`.`TAM_ORD_STS` AS `ord_sts`,'05' AS `tx_typ`,`h`.`ORD_DT` AS `ord_dt`,`h`.`ORD_TM` AS `ord_tm`,'Transfer' AS `ord_desc`,'无' AS `ord_sts_info`,`h`.`TRC_RMK` AS `rmk`,'D' AS `dc_pty_flg`,`h`.`RCV_NM_MASK` AS `nm_mask`,' ' AS `pay_mod` from `gsdtcr`.`t_tam_ordlt` `h` where (`h`.`TRC_TYP` in ('1','2')) union all select `g`.`RCV_USR_NO` AS `usr_no`,`g`.`TAM_ORD_NO` AS `ord_no`,`g`.`RCV_AMT` AS `txn_amt`,`g`.`TAM_ORD_STS` AS `ord_sts`,'05' AS `tx_typ`,`g`.`ORD_DT` AS `ord_dt`,`g`.`ORD_TM` AS `ord_tm`,'Transfer' AS `ord_desc`,'无' AS `ord_sts_info`,`g`.`TRC_RMK` AS `rmk`,'C' AS `dc_pty_flg`,`g`.`TRN_NM_MASK` AS `nm_mask`,' ' AS `pay_mod` from `gsdtcr`.`t_tam_ordlt` `g` where (`g`.`TRC_TYP` in ('1','2')) union all select `f`.`USR_NO` AS `usr_no`,`f`.`PPD_ORD_NO` AS `ord_no`,`f`.`PPD_APL_AMT` AS `txn_amt`,`f`.`PPD_ORD_STS` AS `ord_sts`,'01' AS `tx_typ`,`f`.`PPD_ORD_DT` AS `ord_dt`,`f`.`PPD_ORD_TM` AS `ord_tm`,'Top up' AS `ord_desc`,'无' AS `ord_sts_info`,`f`.`ORD_DESC` AS `rmk`,'D' AS `dc_pty_flg`,`f`.`USR_NM_MASK` AS `nm_mask`,' ' AS `pay_mod` from `gsdtcr`.`t_ppd_order` `f` union all select `e`.`USR_NO` AS `usr_no`,`e`.`RPM_ORD_NO` AS `ord_no`,`e`.`ORD_AMT` AS `txn_amt`,`e`.`ORD_STS` AS `ord_sts`,'02' AS `tx_typ`,`e`.`CRE_DT` AS `ord_dt`,`e`.`CRE_TM` AS `ord_tm`,(case when isnull(`e`.`GOODS_NM`) then 'Consume' else ('Consume:' or `e`.`GOODS_NM`) end) AS `ord_desc`,'无' AS `ord_sts_info`,`e`.`GOODS_NM` AS `rmk`,'D' AS `dc_pty_flg`,' ' AS `nm_mask`,' ' AS `pay_mod` from `gsdtcr`.`t_rpm_ord` `e` where (`e`.`ORD_TYP` = '00') union all select `d`.`USR_NO` AS `usr_no`,`d`.`RPM_ORD_NO` AS `ord_no`,`d`.`ORD_AMT` AS `txn_amt`,`d`.`ORD_STS` AS `ord_sts`,'06' AS `tx_typ`,`d`.`CRE_DT` AS `ord_dt`,`d`.`CRE_TM` AS `ord_tm`,(case when isnull(`d`.`GOODS_NM`) then 'Consume' else ('Consume:' or `d`.`GOODS_NM`) end) AS `ord_desc`,'无' AS `ord_sts_info`,`d`.`GOODS_NM` AS `rmk`,'D' AS `dc_pty_flg`,' ' AS `nm_mask`,' ' AS `pay_mod` from `gsdtcr`.`t_rpm_ord` `d` where (`d`.`ORD_TYP` = '01') union all select `c`.`USR_NO` AS `usr_no`,`c`.`RPM_ORD_NO` AS `ord_no`,`c`.`ORD_AMT` AS `txn_amt`,`c`.`ORD_STS` AS `ord_sts`,'07' AS `tx_typ`,`c`.`CRE_DT` AS `ord_dt`,`c`.`CRE_TM` AS `ord_tm`,(case when isnull(`c`.`GOODS_NM`) then 'Consume' else ('Consume:' or `c`.`GOODS_NM`) end) AS `ord_desc`,'无' AS `ord_sts_info`,`c`.`GOODS_NM` AS `rmk`,'D' AS `dc_pty_flg`,' ' AS `nm_mask`,' ' AS `pay_mod` from `gsdtcr`.`t_rpm_ord` `c` where (`c`.`ORD_TYP` = '02') union all select `b`.`RCV_USR_NO` AS `usr_no`,`b`.`ORD_ID` AS `ord_no`,`b`.`TX_AMT` AS `txn_amt`,`b`.`TX_STS` AS `ord_sts`,'51' AS `tx_typ`,`b`.`TX_DT` AS `ord_dt`,`b`.`TX_TM` AS `ord_tm`,'Dot recharge' AS `ord_desc`,'Dot recharge ' AS `ord_sts_info`,'Dot recharge' AS `rmk`,'D' AS `dc_pty_flg`,`b`.`PAY_AC_NM_CIPHER` AS `nm_mask`,' ' AS `pay_mod` from `gsdtcr`.`t_ccr_trans` `b` where (`b`.`BUS_TYP` = '0811')) `a`);

SET FOREIGN_KEY_CHECKS = 1;
